import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap'
import {  BoxArrowLeft } from 'react-bootstrap-icons';
const custom_style={fontWeight:"bold",marginLeft:"50px"};
const custom_style_logo={fontWeight:"900",marginLeft:"50px"};
function NavbarComponent(){
    return (
        <div>
            
           
            <Navbar bg="light" variant="light">
            <Navbar.Toggle aria-controls="navbarScroll" />
                <Container>
                    <Navbar.Brand href="#home" style={custom_style_logo}>Crack off Campus</Navbar.Brand>
                    <Nav className="me-auto">
                        <Nav.Link href="home" >Jobs</Nav.Link>
                        <Nav.Link href="referals" >Referals</Nav.Link>
                        <Nav.Link href="post" >Post Job</Nav.Link>
                    </Nav>
                    <div style={{display:'flex'}}>
                    <BoxArrowLeft style={{ marginRight:"7px"}} id="logo_account" title = "goodbye" color="#000" size={25}/>
                    </div>
                    <p>Logout</p>
                    

                </Container>
            </Navbar>
        </div >
    )
}

export default NavbarComponent;

